import { ReactElement } from "react";

interface StockResultProps {
    ticker: string
    price: string | undefined
}

function StockResultDisplay({ticker} : StockResultProps, {price} : StockResultProps):ReactElement {
    console.log(`in the display comp it is ${price}`)
    if (ticker && price) {
        console.log("im returning!")
        return(

            <tr>
                <td>{ticker}</td>
                <td>price is {price}</td>

            </tr>
        )
    } else {
        return <div></div>
    }
}


export default StockResultDisplay;
